import React from 'react'

class Questions1 extends React.Component {
    render() {
        const props = this.props
        console.log(this.props);
        if (this.props.currentStep !== 1) {
          return null;
        }
        return (
            <div>
                <p>Questions One</p>
                <label htmlFor="input-1">1</label>
                <input id="input-1" type="checkbox" onChange={ props.onUpdateSelected } /><br />
                <label htmlFor="input-2">2</label>
                <input id="input-2" type="checkbox" onChange={ props.onUpdateSelected } /><br />
                <label htmlFor="input-3">3</label>
                <input id="input-3" type="checkbox" onChange={ props.onUpdateSelected } /><br />
            </div>
        )
    }
}

export default Questions1
